members.member:
Returns the Start Date - if range is true, or the Before date if range is false
@return

Returns the Start Date - if range is true, or the Before date if range is false

member.summary:
Starts a group with the given id, the subsequent calls to writeGroupKeyValue will write the id/values to this group.  After
    the group key is complete writeAttributeValue may be called to add attributes to this group.


    Example Useage
    A group 'demo' is made up of 3 concepts (Country/Sex/Status), and has an attribute (Collection).

DataWriterEngine dre = //Create instance
    dre.startGroup("demo");
    dre.writeGroupKeyValue("Country", "FR");
    dre.writeGroupKeyValue("Sex", "M");
    dre.writeGroupKeyValue("Status", "U");
    dre.writeAttributeValue("Collection", "A");

Any subsequent calls, for example to start a series, or to start a new group, will close off this exiting group.

Gets the AttachmentGroup value;
ATTRIBUTE_ATTACHMENT_LEVEL is GROUP then returns a reference to the Group id that this attribute is attached to.  Returns
null if ATTRIBUTE_ATTACHMENT_LEVEL is not GROUP
